import React, { Component } from 'react';
import {connect} from 'react-redux';

class Comp2 extends Component {

    constructor(props){
        super(props);
        this.state={arr:[]}
    }

    componentDidUpdate(){

        return true;
    }

    render() {

        return (
            <div className="">
                {this.props.data.counter}<br/>
              
                </div>
        );
    }}

    const mapStateToProps = (state)=>{
    return{
        data:state
    }


    };

export default connect(mapStateToProps)(Comp2);
